import { useEffect, useState } from "react";
import "./ProdCard.css";


const url = 'http://localhost:5002/api/getproducts';

const ProductCard = () => {
    const [products, setProducts] = useState([]);


useEffect(() => {
    async function ProductCard() {
        try {
            let response = await fetch(url);
            let data = await response.json();
            setProducts(data.results);
            console.log(products);
        } catch (error) {
            console.log("Something wrong with fetch");
        }
    }
    ProductCard();
},[]);




    return (
        <>
            <a href="#" className="prodCard">
                <img className="prodimg" src="https://static.vecteezy.com/system/resources/previews/001/191/178/non_2x/flower-floral-png.png" />
                {products.map((product) => (
                    <p key={product.name} product={product}></p>
                ))}
            </a>
        </>
    )
};

export default ProductCard;
